import React from 'react'

const api = {
    key: "3be5c39a6dd766aa9edf41c472796b7d",
    base: "https://api.openweathermap.org/data/2.5/"
}

const weather = () => {

    fetch(`${api.base}weather?q=Allentown&units=imperial&APPID=${api.key}`)
        .then(res => res.json())
        .then(weather => {
            console.log(weather)
        }
    )
  return (
    <div>
          <h1>Weather in Lehigh Valley:</h1>
          <p>The current temperature is: {weather.main.temp}</p>
          <p>The high today is: {weather.main.temp_max}</p>
          <p>The low today is: {weather.main.temp_min}</p>
          <p>The humidity is: {weather.main.humidity}</p>
          <p>The wind speed is: {weather.wind.speed}</p>

    </div>
  )
}

export default weather
